import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className='navbar'>
          <h1>Clicky-Game</h1>
          <h3>This is where the instructions go.  Once a game is started this will also dynamically render how many points the user currently has</h3>
        </div>
      </div>
    )
  }
}

export default App;
